import React from 'react'
import styled from 'styled-components';

const CategoriesStyles = styled.div`
    hr{
        margin: 10px 30px; 

    }
`;

const Categories = () => {
  return (
    <CategoriesStyles>
        <div className="cont">
        <Typography></Typography>
        </div>
        <hr />
    </CategoriesStyles>
  )
};

export default Categories;
